function App() {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path='/' element={<Navigate replace to='/home' />} />
        <Route path='/home' element={<Card clasName={showdata}><ShowData /></Card>} />
        <Route path='/add' element={<NewData />} />
      </Routes>
    </BrowserRouter>
  );
}
export default App;
